import UserList from "./userList/userList.container";

const CardView = ({ users, animal }) => {

  const { age, name, isActive, animals }  = { ...users };
  const { given, surname } = { ...name };

  return (
    <div>
      <div>
        {animal}
      </div>
      <UserList users={users} />
    </div>
  )
}

export default CardView;
